import { AppBar, Box, Toolbar, Button, IconButton } from '@mui/material';
// import MenuIcon from '@mui/icons-material/Menu';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import { Link } from 'react-router-dom';
// import { AuthContext } from '../context/AuthContext';
import { useContext } from 'react';
// import { signOut } from 'firebase/auth';
import { useNavigate } from 'react-router-dom';
// import { auth } from '../services/firebase';
import { ReactComponent as BeautySupplyLogo } from '../assets/beauty_supply_logo2.svg';

const Nav = () => {
  // let user = useContext(AuthContext);
  let navigate = useNavigate();

  const handleLogOut = async () => {
    try {
      // await signOut(auth);
      navigate('/login');
    } catch (err: any) {
      console.log(err.message);
    }
  };

  return (
    <Box sx={{ flexGrow: 1, mb: 8, backgroundColor: 'white'  }} aria-label="Navigation bar">
      {/* <AppBar position="static"> */}
        <Toolbar>
          {/* <IconButton size="large" edge="start" color="inherit" aria-label="menu" sx={{ mr: 2 }}>
            <MenuIcon />
          </IconButton> */}
          <Box sx={{ flexGrow: 1, ml: 5 }} aria-label="logo: make it go go. links to the home page.">
            <Link to="/">
              <BeautySupplyLogo style={{ width: '200px', height: 'auto', marginTop: '5px' }} />
            </Link>
          </Box>
          <Link to="/cart">
            <IconButton size="large" edge="start" color="inherit" aria-label="menu" sx={{ mr: 2 }}>
            <ShoppingCartIcon />
          </IconButton>
          </Link>
          {/* {user ? ( */}
            <>
              <Button color="inherit" onClick={handleLogOut}>
                Logout
              </Button>
            </>
          {/* ) : ( */}
            <Button color="inherit" href="/login">
              Login
            </Button>
          {/* )} */}
        </Toolbar>
      {/* </AppBar> */}
    </Box>
  );
};

export default Nav;
